import React from 'react'
import { getUserDetails } from '../utils/api';
import { useNavigate } from "react-router-dom";

const Dashboard = () =>{
    let navigate = useHistory();
    const[user,setUser] = React.useState(null);

    React.useEffect ( () => {
        getUserDetails()
        .then(({data}) => {
            console.log(data);
            setUser(data);
        }).catch((err) => 
        navigate.push('/'));
    })

    return (
      <div>
        Dashboard
      </div>
    )
  }

export default Dashboard;
